import{_ as e,o as r,c as t,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 29.1-407 Forfeiture of furs.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/29.1-407.md","filePath":"vacode/29.1-407.md"}'),a={name:"vacode/29.1-407.md"},i=o('<h1 id="§-29-1-407-forfeiture-of-furs" tabindex="-1">§ 29.1-407 Forfeiture of furs. <a class="header-anchor" href="#§-29-1-407-forfeiture-of-furs" aria-label="Permalink to &quot;§ 29.1-407 Forfeiture of furs.&quot;">​</a></h1><p>Any furs found in the possession of any person or firm and acquired in violation of this article shall be forfeited to the Commonwealth. The proceedings for forfeiture shall conform as far as practicable to the provisions of Chapter 22.1 (§ <a href="http://law.lis.virginia.gov/vacode/19.2-386.1/" target="_blank" rel="noreferrer">19.2-386.1</a> et seq.) of Title 19.2, and the net proceeds of the forfeiture shall be paid into the Literary Fund.</p><p>Code 1950, § 29-102; 1987, c. 488; 2012, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0283" target="_blank" rel="noreferrer">283</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0756" target="_blank" rel="noreferrer">756</a>.</p>',3),f=[i];function n(s,l,c,_,d,h){return r(),t("div",null,f)}const g=e(a,[["render",n]]);export{u as __pageData,g as default};
